import React from 'react'

const Header = ({ITT}) => {
  const ye = card.map((el,i) => (
<div className='card' key={i}>
      <h3>your name is {el.name}</h3>
      <h3>your age is {el.age}</h3>
      <h3>your country is {el.adrress}</h3>
    </div>))
  return (
    <div>{ye}</div>
  )
}

export default Header
